import React from "react";
import '../Styles/Header.css';
import logo from '../imgs/logo.png'
export default function Header(){
  return(
    <header>
      <nav>
        <a href="/" className="header__logo">
          <img src={logo} alt="Netflix Home"/>
        </a>

        <div className=""></div>
        <a href="/" className="header__user"></a>
      </nav>
    </header>
  )
}
